import React, { Component }from "react";
import "../css/filters.css";

// const Filters = props => {
//   return (
    
//   );
// };

class Filters extends Component {
  constructor(props) {
    super(props);
    this.state = {  }
  }
  render() { 
    return ( 
      <div className="filters">
      <div className="all">
        <p>Show ALL</p>
        <button>
          ALL
        </button>
      </div>
      <div className="by-category">
        <p>Browse by category</p>

        <button className="filtersbutton" onClick={props.activeB}>
          ENERGIZERS
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          INOVATION
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          ACION
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          SEALF-LEADERSHIP
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          TEAM
        </button>
        <button id="button-category">by CATEGORY</button>
      </div>
      <div className="time">
        <p>Time frame (minutes)</p>
        <button className="filtersbutton" onClick={props.activeB}>
          5 - 30
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          30 - 60
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          60 - 120
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          120 -240
        </button>
        <button id="by-time">by TIME</button>
      </div>
      <div className="group">
        <p>Group size</p>
        <button className="filtersbutton" onClick={props.activeB}>
          2 - 10
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          10 - 40
        </button>
        <button className="filtersbutton" onClick={props.activeB}>
          40 +
        </button>
        <button id="group-btn">by GROUP</button>
      </div>
    </div>
     );
  }
}
 
export default Filters;
